@fox_besos when he does show himself 
- constantly feeling like he has to the "good kind" of "alien" otherwise people won't accept him 
- constant fear of being "found out"

@fox_besos - forced to disguise themselves to fit in and not be ostracized 
- his existence alone is viewed as an act of activism which people either accept or they dont but it's thrust upon him all the same 
- feeling free with his "true" self but there exists a poignant loneliness
